                        fg.AppendLine("]");
                    }
                }
                fg.AppendLine("]");
            }
            if ((printMask?.Description ?? true)
                && item.Description is {} DescriptionItem)
            {
                fg.AppendItem(DescriptionItem, "Description");
            }
